import React, { Component } from 'react'
import { Box } from 'grommet';

export class Welcome extends Component {
    render() {
        return (
            <Box align='center' justify='center'>
                <h2>Bienvenu sur mon profil</h2>
            </Box>
        )
    }
}

export default Welcome
